"tabRenderer":{"endpoint":{"clickTrackingParams":"CCUQ8JMBGAUiEwiLzN_k_LWGAxXLmGMGHU2QArQ=","commandMetadata":{"webCommandMetadata":{"url":"/@ArizonaPBS/featured","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCKA96CEncEYIkocsdwaMt-w","params":"EghmZWF0dXJlZPIGBAoCMgA%3D","canonicalBaseUrl":"/@ArizonaPBS"}},"title":"Home","selected":true,"content":{"sectionListRenderer":{"contents":[{"itemSectionRenderer":{"contents":[{"channelVideoPlayerRenderer":{"videoId":"efghTHL3ECI","title":{"runs":[{"text":"AJ Odneal performs \"No one is Constellation by Themself\" | Playlist 48","navigationEndpoint":{"clickTrackingParams":"CMgFELsvGAAiEwiLzN_k_LWGAxXLmGMGHU2QArQ=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=efghTHL3ECI","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"efghTHL3ECI","watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-nau-jhcs.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=79f8214c72f71022\u0026ip=112.134.171.20\u0026initcwndbps=552500\u0026mt=1717092307\u0026oweuc="}}}}}}],"accessibility":{"accessibilityData":{"label":"AJ Odneal performs \"No one is Constellation by Themself\" | Playlist 48 by Arizona PBS 72 views 12 days ago 2 minutes, 46 seconds"}}},"description":{"runs":[{"text":"Singer/songwriter AJ Odneal has been making up songs from a very young age. “I remember writing little goofy songs growing up,” she said. But her songwriting quickly found a purpose.\n\n“In middle school, I started writing songs for the purpose of processing what I was feeling,” Odneal explained. “And that’s what songwriting has really become for me.”\n\nOdneal’s indie folk style music is heavily influenced by pop and jazz. She uses both the guitar and ukulele to accompany her smooth vocals and clever lyrics.\n\nOdneal’s latest EP is called “No One Is a Constellation By Themself.” “That song is about community,” she said about the title track. “It’s about knowing that we’re all pretty cool, and we’re much cooler when we’re with other people and supporting each other.” The song is bubbly and chipper and hummable.\n\nOther songs are more somber. Odneal speaks about the challenging relationship with her late grandmother. “It wasn’t until she had dementia that she cared about me,” she said. “She told me she loved me for the first time as she was dying.” Songwriting helped her come to peace with the complicated emotions that surrounded the experience: It turned into a song called “Didn’t Know My Name.”\n\nComing to peace became a theme for the EP, Odneal said. “Everyone’s a star, but you can’t be a constellation by yourself.”"}]},"viewCountText":{"simpleText":"72 views"},"publishedTimeText":{"runs":[{"text":"12 days ago"}]},"readMoreText":{"runs":[{"text":"Read more","navigationEndpoint":{"clickTrackingParams":"CMgFELsvGAAiEwiLzN_k_LWGAxXLmGMGHU2QArQ=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=efghTHL3ECI","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"efghTHL3ECI","watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-nau-jhcs.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=79f8214c72f71022\u0026ip=112.134.171.20\u0026initcwndbps=552500\u0026mt=1717092307\u0026oweuc="}}}}}}]}}}],"trackingParams":"CMgFELsvGAAiEwiLzN_k_LWGAxXLmGMGHU2QArQ="}},{"itemSectionRenderer":{"contents":[{"shelfRenderer":{"title":{"runs":[{"text":"News and public affairs on AZPBS Now","navigationEndpoint":{"clickTrackingParams":"CJ0FENwcGAAiEwiLzN_k_LWGAxXLmGMGHU2QArQ=","showEngagementPanelEn
